import React from 'react';

const itemList = () => (<ul>
  <li>play with me</li>
  <li>feed me</li>
</ul>);

const App = () => (<div>
  <h1 style={{
    color: 'crimson'
    }}>Hello, Olga!
  </h1>
  <itemList />
</div>);

export default App;
